import React, { useState, useEffect } from 'react';
const Card = ({ apiKey }, props) => {

    const [users, setUser] = useState([]);

    const getUser = async () => {
        const response = await fetch('https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json')
        setUser(await response.json());
    }

    //      users.map((users) =>

    // )

    useEffect(() => {
        getUser();
    }, [apiKey]);

    return (
        <div class="card-group">
            <div class="card">
                <div className="card-body">
                    <img src="https://s3.ap-southeast-1.amazonaws.com/imgnew.outlookindia.com/uploadimage/library/16_9/16_9_5/IMAGE_1643090345.jpg" class="card-img" alt="text">
                    </img>

                    <h6 class="card-text">{users.index_name}</h6>
                    <h6 class="card-title">
                        {users.title}</h6>


                    <h6 class="card-text">{users.desc}</h6>
                    <h6 class="card-text">{users.org}</h6>
                    <h6 class="card-text">{users.source}</h6>
                    <h6 class="card-text">{users.org}</h6>
                    <h6 class="card-text">{users.sector}</h6>

                    <h6 class="card-text">{users.index}</h6>

                    {/* <h6 class="card-text">{users.target_bucket.index}</h6> */}
                    {/* <h6 class="card-text">{users.target_bucket.type}</h6>
                    <h6 class="card-text">{users.target_bucket.field}</h6>
                    */}
                    {/* <h6 class="card-text">{users.records[0].category}</h6>
                    <h6 class="card-text">{users.records[0].india_state_union_territory}</h6>
                    <h6 class="card-text">{users.records[0].population_2011}</h6>
                    <h6 class="card-text">{users.records[0].decadal_population_growth_rate___2001_2011}</h6>
                    <h6 class="card-text">{users.records[0].population_density_per_sq_km___2011}</h6> */}



                </div>

            </div >
        </div>








    );
}

export default Card;
